import React from 'react';
import bg from './background.jpg';
import './App.css';

function App() {
  return (
    <div className=" w-full mx-auto  bg-grey-700">
        <img src={bg} className="w-full bg-auto bg-center h-screen opacity" />
    </div>
  );
}

export default App;
